import React, {Component} from 'react';
import './Contact.css';

class Contact extends Component{

    render(){
        return(
            <div className="Contact-container">
                <h1 className="Name contact">C O N T A C T</h1>
                <div className="contact-content"></div>

            </div>
        ); 
    }

}

export default Contact;
